// SPDX-License-Identifier: SimPL-2.0

pragma solidity ^0.8.0;
pragma experimental ABIEncoderV2;

import "./RichShop.sol";
import "./RichHero.sol";

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC1155/IERC1155.sol";
import "@openzeppelin/contracts/token/ERC1155/utils/ERC1155Receiver.sol";

import "@openzeppelin/contracts/utils/Address.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";

/**·
* @title Rich Hero - Romance of the Three Kingdoms NFT
*
*
* Docs: 
*
* Version v1.1.0
*
*/

contract Training is Ownable, ERC1155Receiver {
    using SafeMath for uint256;

    uint256 public constant PCT_BASE = 1e18;
    uint256 public constant RAND_BASE = 10000;
        // _addItem("ZHJ", 1, 100); //纵横卷 tokenId: 0
        // _addItem("TGL", 1, 100); //太公略 tokenId: 1
        // _addItem("SHJ", 1, 100); //山海经 tokenId: 2
        // _addItem("SGZ", 1, 100); //三国志 tokenId: 3
        // _addItem("Excellent_Gem", 1, 100); //优秀宝石 tokenId: 4
        // _addItem("Epic_Gem", 1, 100); //史诗宝石 tokenId: 5
        // _addItem("Legend_Gem", 1, 100); //传说宝石 tokenId: 6
        // _addItem("Break_Gem", 1, 100); //突破宝石 tokenId: 7
        // _addItem("Advanced_Gem", 1, 100); //进阶宝石 tokenId: 8
        // _addItem("LY_Stone", 1, 100); //两仪石 tokenId: 9
        // _addItem("Drum", 0, 100); //战鼓 tokenId: 10
        // _addItem("Forage", 0, 100); //粮草 tokenId: 11
    uint64[] public gemsAddition = [2000, 500, 200];
    uint64[] public advanceAdditions = [105, 25, 130, 21];
    uint64[] public advanceAdditionLevels = [6000, 4000];
    uint64 public advanceGemAddition = 1000;

    uint256[] public books = [0, 1, 2, 3];
    uint256[] public gems = [4, 5, 6];
    uint256 public breakGem = 7;
    uint256 public advanceGem = 8;
    uint256 public ly_stone = 9;

    uint256[] public gemsCost = [1, 2, 4, 8];
    RichHero public HERO;
    RichShop public SHOP;
    mapping (uint64 => mapping(uint64 => uint64[3])) public _baseAddition; //rarity => star => [main, other, book]
    mapping (uint64 => mapping(uint64 => uint64[4])) public _baseQualities; //card1 => card2 => [normal, excellent, epic, legend]

    constructor(address nft, address shop) {
        require(Address.isContract(nft), "Nft Invalid");
        require(Address.isContract(shop), "Nft Invalid");
        HERO = RichHero(nft);
        SHOP = RichShop(shop);
        //升级基础提升和消耗
        //白卡
        _baseAddition[0][0] = [2, 1, 1];
        _baseAddition[0][1] = [2, 1, 1];
        //蓝卡
        _baseAddition[1][0] = [2, 1, 2];
        _baseAddition[1][1] = [3, 2, 2];
        _baseAddition[1][2] = [4, 3, 2];
        _baseAddition[1][3] = [5, 4, 2];
        //紫卡
        _baseAddition[2][0] = [2, 1, 3];
        _baseAddition[2][1] = [3, 2, 3];
        _baseAddition[2][2] = [4, 3, 4];
        _baseAddition[2][3] = [5, 4, 4];
        _baseAddition[2][4] = [6, 5, 4];
        //橙卡
        _baseAddition[3][0] = [2, 1, 5];
        _baseAddition[3][1] = [3, 2, 5];
        _baseAddition[3][2] = [4, 3, 5];
        _baseAddition[3][3] = [5, 4, 6];
        _baseAddition[3][4] = [6, 5, 6];
        _baseAddition[3][5] = [7, 6, 6];
        //金卡
        _baseAddition[4][0] = [2, 1, 10];    
        _baseAddition[4][1] = [3, 2, 10];
        _baseAddition[4][2] = [4, 3, 10];
        _baseAddition[4][3] = [5, 4, 10];
        _baseAddition[4][4] = [6, 5, 10];
        _baseAddition[4][5] = [7, 6, 10];    
        _baseAddition[4][6] = [8, 7, 10];
        _baseAddition[4][7] = [9, 8, 10];
        _baseAddition[4][8] = [10, 9, 10];
        _baseAddition[4][9] = [11, 10, 10];
        _baseAddition[4][10] = [12, 11, 10];

        //不同组合升阶概率
        _baseQualities[0][0] = [8000, 1999, 1, 0]; //普+普
        _baseQualities[0][1] = [4900, 4900, 199, 1];//普+优
        _baseQualities[1][0] = [4900, 4900, 199, 1];//优+普
        _baseQualities[0][2] = [2500, 5000, 2400, 100];//普+史
        _baseQualities[2][0] = [2500, 5000, 2400, 100];//史+普
        _baseQualities[0][3] = [2000, 3000, 4000, 1000];//普+传
        _baseQualities[3][0] = [2000, 3000, 4000, 1000];//传+普
        _baseQualities[1][1] = [0, 8000, 1990, 10];//优+优
        _baseQualities[1][2] = [0, 4900, 4900, 200];//优+史
        _baseQualities[2][1] = [0, 4900, 4900, 200];//史+优
        _baseQualities[1][3] = [0, 1500, 7500, 1000];//优+传
        _baseQualities[3][1] = [0, 1500, 7500, 1000];//传+优
        _baseQualities[2][2] = [0, 0, 8500, 1500];//史+史
        _baseQualities[2][3] = [0, 0, 7000, 3000];//史+传
        _baseQualities[3][2] = [0, 0, 7000, 3000];//传+史
        _baseQualities[3][3] = [0, 0, 200, 9800];//传+传

        //0xAAd1f995F6994BEf38Cadc711f533F9629e4839c;
        // uint256 tokenId = tokenListLength++;
        // _heros[tokenId] = HeroDetail(
        //     tokenId, 5, 0, 0, 1, block.timestamp
        // );
        // _mint(address(0xAAd1f995F6994BEf38Cadc711f533F9629e4839c), tokenId);
    }

    function upgradeLevel(uint256 tokenId) public {
        require(HERO.ownerOf(tokenId) == msg.sender);
        RichHero.HeroDetail memory detail = HERO.getHero(tokenId);
        require(detail.level < 5);
        IERC1155(SHOP).safeTransferFrom(msg.sender, address(this), books[detail.quality], _baseAddition[detail.rarity][detail.star][2], "");
        uint64[] memory properties = new uint64[](5);
        for (uint256 i = 0; i < 5; i++) {
            if (detail.preference == 5) {
                properties[i] = _baseAddition[detail.rarity][detail.star][0]*detail.addition + detail.properties[i];
            } else {
                if (detail.preference == i) {
                    properties[i] = _baseAddition[detail.rarity][detail.star][0]*detail.addition + detail.properties[i];
                } else {
                    properties[i] = _baseAddition[detail.rarity][detail.star][1]*detail.addition + detail.properties[i];
                }
            }
        }
        HERO.setHero(tokenId, detail.level+1, detail.star, properties);
    }

    function onekeyUpgradeLevel(uint256 tokenId) public {
        require(HERO.ownerOf(tokenId) == msg.sender);
        RichHero.HeroDetail memory detail = HERO.getHero(tokenId);
        require(detail.level < 5);
        uint256 balance = IERC1155(SHOP).balanceOf(msg.sender, books[detail.quality]);
        require(balance >= _baseAddition[detail.rarity][detail.star][2]);
        uint64 maxUpgradeLevel = 5 - detail.level;
        uint64 enoughUpgradeLevel = uint64(balance) / _baseAddition[detail.rarity][detail.star][2];
        uint64[] memory properties = new uint64[](5);
        if (maxUpgradeLevel > enoughUpgradeLevel) {
            IERC1155(SHOP).safeTransferFrom(msg.sender, address(this), books[detail.quality], _baseAddition[detail.rarity][detail.star][2]*enoughUpgradeLevel, "");
            for (uint256 i = 0; i < 5; i++) {
                if (detail.preference == 5) {
                    properties[i] = _baseAddition[detail.rarity][detail.star][0]*detail.addition*enoughUpgradeLevel + detail.properties[i];
                } else {
                    if (detail.preference == i) {
                        properties[i] = _baseAddition[detail.rarity][detail.star][0]*detail.addition*enoughUpgradeLevel + detail.properties[i];
                    } else {
                        properties[i] = _baseAddition[detail.rarity][detail.star][1]*detail.addition*enoughUpgradeLevel + detail.properties[i];
                    }
                }
            }
            HERO.setHero(tokenId, detail.level+uint8(enoughUpgradeLevel), detail.star, properties);
        } else {
            IERC1155(SHOP).safeTransferFrom(msg.sender, address(this), books[detail.quality], _baseAddition[detail.rarity][detail.star][2]*maxUpgradeLevel, "");
            for (uint256 i = 0; i < 5; i++) {
                if (detail.preference == 5) {
                    properties[i] = _baseAddition[detail.rarity][detail.star][0]*detail.addition*maxUpgradeLevel + detail.properties[i];
                } else {
                    if (detail.preference == i) {
                        properties[i] = _baseAddition[detail.rarity][detail.star][0]*detail.addition*maxUpgradeLevel + detail.properties[i];
                    } else {
                        properties[i] = _baseAddition[detail.rarity][detail.star][1]*detail.addition*maxUpgradeLevel + detail.properties[i];
                    }
                }
            }
            HERO.setHero(tokenId, 5, detail.star, properties);
        }
    }

    function upgradeStar(uint256 tokenId) public {
        require(HERO.ownerOf(tokenId) == msg.sender);
        RichHero.HeroDetail memory detail = HERO.getHero(tokenId);
        require((detail.star < HERO.topStar(detail.rarity)) && (detail.level == 5));
        IERC1155(SHOP).safeTransferFrom(msg.sender, address(this), breakGem, _baseAddition[detail.rarity][detail.star][2]*2, "");
        // upgrade 2 level
        uint64[] memory properties = new uint64[](5);
        for (uint256 i = 0; i < 5; i++) {
            if (detail.preference == 5) {
                properties[i] = _baseAddition[detail.rarity][detail.star][0]*detail.addition*2 + detail.properties[i];
            } else {
                if (detail.preference == i) {
                    properties[i] = _baseAddition[detail.rarity][detail.star][0]*detail.addition*2 + detail.properties[i];
                } else {
                    properties[i] = _baseAddition[detail.rarity][detail.star][1]*detail.addition*2 + detail.properties[i];
                }
            }
        }
        HERO.setHero(tokenId, 0, detail.star+1, properties);
    }

    function upgradeRarity(uint256[] memory tokenIds, bool useUpgradeGem, uint256 gemId, bool useAdvanceGem) public {
        require(tokenIds.length == 2);
        require(HERO.ownerOf(tokenIds[0]) == msg.sender && HERO.ownerOf(tokenIds[1]) == msg.sender);
        RichHero.HeroDetail memory detail1 = HERO.getHero(tokenIds[0]);
        RichHero.HeroDetail memory detail2 = HERO.getHero(tokenIds[1]);
        require(detail1.rarity == detail2.rarity && detail1.rarity < 4);
        require(detail1.camp == detail2.camp);
        uint256 randIndex;
        for (uint256 i = 0; i < 2; i++) {
            HERO.transferFrom(msg.sender, address(this), tokenIds[i]);
        }
        //todo limit upgrade golden
        uint64[] memory properties1 = new uint64[](5);
        uint64[] memory properties2 = new uint64[](5);
        for (uint64 i = 0; i < 5; i++) {
            properties1[i] = detail1.properties[i];
            properties2[i] = detail2.properties[i];
        }
        if ((detail1.preference != detail2.preference) && (detail1.rarity == 3)) {
            (properties2[detail1.preference], properties1[detail2.preference]) = (properties2[detail2.preference], properties2[detail1.preference]);
        }
        for (uint64 i = 0; i < 5; i++) {
            properties1[i] = properties1[i] + properties2[i];
        }
        uint64[] memory oldDetail = new uint64[](6);
        oldDetail[0] = 1;
        oldDetail[1] = detail1.rarity+1;
        oldDetail[2] = 0;
        oldDetail[3] = 0;
        {
            uint64[] memory qualities = new uint64[](4);
            uint64[] memory advanceAdditionLevel = new uint64[](2);
            uint64 leastQuality;
            for (uint64 i = 0; i < 4; i++) {
                qualities[i] = _baseQualities[detail1.quality][detail2.quality][i];
                if ((qualities[i] != 0) && (leastQuality == 0)) {
                    leastQuality == i;
                }
            }
            for(uint256 i = 0; i < 2; i++) {
                advanceAdditionLevel[i] = advanceAdditionLevel[i];
            }
            if (useUpgradeGem) {
                require((gemId > leastQuality) && (gemId < gems.length));
                IERC1155(SHOP).safeTransferFrom(msg.sender, address(this), gems[gemId], gemsCost[detail1.rarity], "");
                qualities[leastQuality] -= gemsAddition[gemId];
                qualities[gemId+1] += gemsAddition[gemId];
            }
            if (useAdvanceGem) {
                IERC1155(SHOP).safeTransferFrom(msg.sender, address(this), advanceGem, gemsCost[detail1.rarity], "");
                advanceAdditionLevel[0] -= advanceGemAddition;
                advanceAdditionLevel[1] += advanceGemAddition;
            }
            uint256 qualityTotal;
            uint256 ranQuality = _random(RAND_BASE, randIndex++);
            for (uint64 i = 0; i < 4; i++) {
                qualityTotal = qualityTotal.add(qualities[i]);
                if (ranQuality >= qualityTotal) {
                    continue;
                } else {
                    oldDetail[4] = i; //quality
                    break;
                }
            }
            uint256 level;
            uint256 advanceAdditionLevelTotal;
            uint256 ranAddition = _random(RAND_BASE, randIndex++);
            for (uint64 i = 0; i < 2; i++) {
                advanceAdditionLevelTotal = advanceAdditionLevelTotal.add(advanceAdditionLevel[i]);
                if (ranAddition >= advanceAdditionLevelTotal) {
                    continue;
                } else {
                    level = i; //quality
                    break;
                }
            }
            uint64 advanceAddtion;
            if (level == 0) {
                advanceAddtion = advanceAdditions[0] + _random(advanceAdditions[1], randIndex++);
            } else {
                advanceAddtion = advanceAdditions[2] + _random(advanceAdditions[3], randIndex++);
            }
            for (uint64 i = 0; i < 5; i++) {
                properties1[i] = properties1[i]*advanceAddtion/100;
            }
        }
        {
            (uint64 baseAddition, uint64 additionMod) = HERO.additions(oldDetail[4]);
            oldDetail[5] = baseAddition + uint64(_random(additionMod, randIndex++)); //addition
            uint64[] memory newDetail = new uint64[](13);
            newDetail = _choose(oldDetail, detail1.preference, properties1, true, detail1.camp);
            //burn and mint
            for (uint256 i = 0; i < 2; i++) {
                HERO.removeHero(tokenIds[i]);
            }
            HERO.mint(msg.sender, newDetail);
        }
    }

    function rebirth(uint256 tokenId) public {
        require(HERO.ownerOf(tokenId) == msg.sender);
        RichHero.HeroDetail memory detail = HERO.getHero(tokenId);  
        require(detail.rarity < 4);
        IERC1155(SHOP).safeTransferFrom(msg.sender, address(this), ly_stone, gemsCost[detail.rarity], "");
        uint64[] memory oldDetail = new uint64[](6);
        uint64[] memory properties = new uint64[](5);
        for (uint64 i = 0; i < 5; i++) {
            properties[i] = detail.properties[i];
        }
        oldDetail[0] = detail.native;
        oldDetail[1] = detail.rarity;
        oldDetail[2] = detail.level;
        oldDetail[3] = detail.star;
        oldDetail[4] = detail.quality;
        oldDetail[5] = detail.addition;
        uint64[] memory newDetail = new uint64[](13);
        newDetail = _choose(oldDetail, detail.preference, properties, true, detail.camp);
        HERO.rebirth(tokenId, newDetail);
    }

    function supportsInterface(bytes4 interfaceId) public view virtual
        override(ERC1155Receiver) returns (bool) {
        return super.supportsInterface(interfaceId);
    }

    function onERC1155Received(
        address operator,
        address from,
        uint256 id,
        uint256 value,
        bytes calldata data
    )
    external
    override
    pure
    returns(bytes4)
    {
        this.onERC1155BatchReceived.selector;
    }

    function onERC1155BatchReceived(
        address operator,
        address from,
        uint256[] calldata ids,
        uint256[] calldata values,
        bytes calldata data
    )
    external
    override
    pure
    returns(bytes4)
    {
        this.onERC1155BatchReceived.selector;
    }

    function _random(uint256 _value, uint256 index) private view returns (uint64) {
        bytes memory seed = abi.encodePacked(block.timestamp, index, msg.sender);
        return uint64(uint256(keccak256(seed)) % _value);
    }

    function _choose(uint64[] memory detail, uint64 preference, uint64[] memory properties, bool saveCamp, uint64 camp) private view
        returns (uint64[] memory) {
        uint64[] memory heroDetail = new uint64[](13);
        uint256 randIndex = 0;
        heroDetail[0] = detail[0]; //native
        if (!saveCamp) {
            heroDetail[1] = uint64(_random(uint256(HERO.camps()), randIndex++)); //camp
        } else {
            heroDetail[1] = camp;
        }
        heroDetail[2] = detail[1];//rarity
        heroDetail[3] = uint64(_random(uint256(HERO.heroIds(heroDetail[2])), randIndex++)); //heroId
        heroDetail[4] = detail[2]; //level
        heroDetail[5] = detail[3]; //star  
        heroDetail[6] = detail[4]; //quality
        heroDetail[7] = detail[5]; //addition
        (uint64 newPreference,,,,,) = HERO._heroInitials(heroDetail[1], heroDetail[2], heroDetail[3]); //preference
        (properties[preference], properties[newPreference]) = (properties[newPreference], properties[preference]);
        heroDetail[8] = properties[0];
        heroDetail[9] = properties[1];
        heroDetail[10] = properties[2];
        heroDetail[11] = properties[3];
        heroDetail[12] = properties[4];
        return heroDetail;
    }

    function setShop(address shop) public onlyOwner {
        SHOP = RichShop(shop);
    }

    function setHero(address hero) public onlyOwner {
        HERO = RichHero(hero);
    }
}
